export const Contact = () => {
  return (
    <section className="contact_section">
      <div className="container">
        <div className="row">
          <div className="col-md-6"></div>
          <div className="col-md-6">
            <div className="img-box">
              <img src="images/mercedes-car-1.png" alt="" />
            </div>
          </div>
        </div>
      </div>
    </section>
  );
};
